import "./Footer.css";
import Order from "./Order";

function Footer() {
  const hour = new Date().getHours();
  const openHour = 12;
  const closeHour = 22;
  const isOpen = hour >= openHour && hour <= closeHour;
  //   console.log(hour);
  return <Order isOpen={isOpen} openHour={openHour} closeHour={closeHour} />;
}

export default Footer;
